	('80999257', '638', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '신흥2리마을에 대한 소개입니다.\n제주에서는 동백꽃을 흔하게 마당에 심곤 합니다. 하지만 이렇게 흔한 동백나무가 귀한 대접을 받는 곳. 그곳이 바로 신흥2리 동백마을이다. 마을 곳곳마다 동백나무가 붉게 늘어 서 있고 제주도 기념물 제27호로 지정되었고, 제8회 아름다운 숲 전국대회- 전통마을 숲 분야 어울림상 수상, 제10회 아름다운 숲 전국대회- 아름다운 숲지기상을 수상한 동백나무 군락지를 볼 수 있다. 설촌 300년의 역사만큼 장수마을을 자랑하는 이유도 좋은 환경덕분이라 생각합니다. 아름다운 자연과 천천히 느리게 사는 삶의 철학이 그 비결이기도 하다.동백열매를 이용하여 만드는 동백기름, 동백비누 등 앞으로 300년을 내다보는 희망프로젝트를 펼치는 곳으로 나아가겠습니다. 동백마을은 동백을 이용한 다양한 이색체험이 가능하며 마을에서 편히 묵어갈 수 있는 숙박을 운영하고 있다.<br>', '2020-06-14 02:30:29', '2020-06-14 11:30:32'),
