	('80999257', '648', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '사라봉의 소개정보입니다.\n\n제주항 동쪽으로 바닷가를 접해 위치한 오름으로 제주시를 대표하는 오름이라고 할 수 있다. 이오름 봉우리에 오르면 북쪽으로 망망한 바닷가가 눈앞에 펼쳐지고, 남쪽으로 웅장한 한라산이 바라다 보이며, 발아래에는 제주시의 시가지와 주변의 크고작은 마을들이 그림같이 아름답고, 특히 저녁 붉은노을이 온 바다를 물들이는 광경(沙峰落照)은 장관이어서 영주십경(瀛州十景)의 하나로 꼽힌다. 오름의 형태는 북서쪽으로 벌어진 말굽형 화구로서 붉은 송이(scoria)로 구성된 기생화산체이며, 전체적으로 해송이 조림되어 숲을 이루고 있다. <br>', '2020-06-14 03:37:02', '2020-06-14 12:37:03'),
