	('80999257', '666', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '법화사의 소개정보입니다.\n\n법화사는 제주도 서귀포시 하원동에 위치하며 대한 불교조계종 제23교구 관음사의 말 사이다.(제주도 서귀포시 하원동에 고즈넉하게 자리 잡은 법화사(法華寺)는 서기 840년경 후기 신라시대, 중국과 일본을 무대로 활동했던 해상왕 장보고가 건립한 사찰이다. 완도 청해진의 법화사와 더불어 산둥반도에는 법화원, 제주에 법화사를 창건하고 바다로 나가는 사람의 안녕을 기원하는 한편 세계로 향하는 해상세력의 근거지를 만들고자 한 것이다. 법화사의 정확한 창건 연대는 전해오지 않으나, 1982년부터 8차례에 걸친 발굴로 법화사지의 규모와 성격이 확인됐다. 특히 1992년 발굴 과정에서 발견된 명문 기와편을 통해 1279년(고려 충렬왕 5)에 중창되었음이 밝혀졌다. 또 기록에 의하면 법화사의 노비가 280명에 달해 그 규모가 상당히 컸으리라 추측이 된다.<br>', '2020-06-14 05:27:14', '2020-06-14 14:27:15'),
