	('80999257', '697', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '제주돌문화공원의 소개정보입니다.\n\n돌문화 공원은 돌의 고장 제주에 있는 돌문화를 종합적이고 체계적으로 보여주는 박물관이자 생태공원이다.2020년까지 전체공원이 조성되며, 제1단계로 제주돌박물관, 제주돌문화전시관, 제주의 전통초가 등의 전시관이 완공되어 공사가 시작된지 7년 만인 2006년 6월 3일 문을 열었다. 제주의 돌문화를 한곳에서 볼 수 있는 돌문화공원은 규모가 워낙 커서 여유로운 일정으로 둘러보는 것이 좋다. 돌문화 공원은 제주만의 독특한 자연유산인 오름 앞에 자리잡고 있으며, 돌을 쌓아 만들어 놓은 성곽의 형태를 따라 나지막한 오르막길을 올라가면 주변 전망이 시원한 돌문화공원 입구에 다다르게 된다.<br /><br />입구를 지나 관람로를 따라가다보면 설문대할망과 그 아들인 오백장군 설화로 엮은 각종 돌조형물들을 만나게 되고,거석 사이를 통과하여 숲속오솔길을 따라가다 보면 박물관과 제주의 전통초가들을 볼 수 있는데, 특이하게도 박물관은 지상이 아닌 지하에 자리잡고 있다. 자연 환경과 주변 경관을 해치지 않기 위해서 그렇게 지어졌다고 한다. 야외 전시장에는 48기의 돌하르방, 사악한 기운과 액운을 몰아낸다는 방사탑, 도둑이 없어 대문도 없다는 제주의 상징인 정주석, 무덤 주위에 세워 망자의 한을 달래준다는 제주만의 내세관을 보여주는 동자석 등 제주의 역사와 전통 자연미를 함께 느낄수 있는 자연과 문화의 쉼터이다.<br>', '2020-06-14 08:19:59', '2020-06-14 17:20:00'),
