	('80999257', '700', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '제주조각공원의 소개정보입니다.\n\n서귀포시 산방산(395m) 동북쪽에 자리 잡은 제주조각공원은 1987년 10월에 개관했다. 13만여 평의 제주 원시림 속에 조성된 조각공원이다. 중문관광단지를 돌아보고 대정읍으로 향하는 길에 꼭 방문해 볼 곳이다. 자연과 예술과 인간의 만남을 주제로하여 국내의 유명원로 및 중견작가(109명)들이 출품한 160여 점의 조각작품이 주변의 아름다운 경치와 조화롭게 전시되어 대장관을 이룬다. 공원 내에는 정문관, 각종 예술행사를 펼칠 수 있는 혼밭광장, 광대한 잔디광장, 산방산, 한라산과 국토 최남단인 마라도를 바라다볼 수 있는 전망대 등이 있다.<br>', '2020-06-14 08:26:14', '2020-06-14 17:26:14'),
