	('1087356828', '720', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '금능으뜸원해변의 소개정보입니다.\n\n* 2019 해수욕장 개장정보<br>- 기간: 6.24.~8.31.<br>- 시간: 10:00~19:00<br><br>투명한 맑은 물과 흰 모래와 조가비가 섞여 길게 이어진 아름다운 백사장, 낙조의 경관이 환상적인 이곳 앞바다에는 비양도가 있다. 얕고 새파란 바닷물 밑으로 비치는 새하얀 모래사장은 비양도까지 걸어서라도 갈 수 있을 것 같은 착각에 사로잡히게 한다.', '2020-06-14 12:18:35', '2020-06-14 21:18:36'),
	('1087356828', '721', '44389261', 'Younghoon', 'KANG', '제지기오름 정보', '2020-06-14 13:31:00', '2020-06-14 22:31:01'),
	('1087356828', '722', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '제지기오름의 소개정보입니다.\n\n조면암질 화산암과 일부 화산쇄설성 퇴적층으로 구성되어 전체적인 모양은 용암원정구의 형태를 띠고 있으며 남사면은 매우 가팔라서 곳곳이 벼랑져 있다. 숲이 덮힌 외관으로는 나타나지 않지만 안에 들면 곳곳에 바위가 서 있고 커다란 바위등이 드러나 있다.<br />정상부는 나무가 없고 환상탈모 대머리처럼 둥그렇게 벗어졌고 억새며 잡풀이 무성하다. 북사면은 급준하게 솟아 오른 남사면과 달리 비교적 완만한 등성이가 두 가닥으로 뻗어 내리고 그 가랑이진 곳이 각각 서향·북향·북동향으로 야트막히 우묵져 있다. 화구로 보일 만큼의 뚜렷한 형태는 아니다.<br />남사면 중턱의 바위굴은 꽤 커서 입구 쪽이 6-7미터, 깊이 5-6미터의 넓이에 천장 높이 최고 6미터 가량이며, 밑으로는 가파르게 비탈져 풀과 나무가 우거지고 양옆으로도 벼랑바위가 우뚝우뚝하다. 옛날 절이 있었던 데서 절오름, 일명 제지기오름 또는 제제기오름이라고도 한다. 제지기(제제기)가 무슨 뜻인지는 분명치 않으나, 절(窟寺)이 있고 이를 지키는 절지기가 살고 있었으므로 절지기오름이라 불리던 것이 차차 제지기오름·제제기오름으로 와전된 것이라고 풀이돼 있다. 어떻든 절이 있었던데 연유한 절오름이라는 호칭만은 분명하며, 여러 문헌에 절오름(寺岳)으로 명기돼 있으며 현지 주민들 사이에도 그리 알려져 있다. 그 절은 바다에 면한 남사면 중턱의 궤(바위 굴) 안에 있었다고 한다. 절 이름이 무엇이었는지, 어느 시기였는지는 알려져 있지 않으며 흔적도 찾아볼 수 없다. 다만 굴사(窟寺)라는 옛 호칭이 남아있을 뿐이다. 건물이 있는 것도 아닌, 간소한 굴암(窟庵) 이었으리라 짐작되며, 제즈기오름, 제지기오름, 제좌기오름, 저저기오름, 제지기오름 현지인들은 이 오름에 과거 절(寺)이 있었고, 절을 지키는 `절지기/저지기`가 있었다는 데서 `저지기오름, 제지기오름` 또는 `절오름`이라 한다고 하나, 신빙성이 없어 보인다. 음성형도 확실하지 않고 뜻 또한 확실하지 않으며,음성형은 물론 그 뜻에 대해서도 좀더 논의해야 한다고 한다.<br />동녘 오름자락 당팟이라는 불리는 곳은 옛날 당(堂)이 있었던 데 연유하는 지명인데 그 당은 오래 전에 북서쪽 정술냇가 `조노궤`라는 큼직한 바위굴로 옮겨졌습니다. 보목마을 수호신을 모신 `조노궤당`이다.<br />마을 중심부를 흐르는 정술내(甫木川)는 멀리 솔오름(미악산)에서 발원, 남동으로 흐르면서 상효천과 합류, 절오름 서록에 이르러 보목마을을 동서로 가르며 바다로 들어간다.<br />앞 바다에 작은 화산도 섶섬이 절오름과 1km의 사이를 두고 마주보고 있다. 섶섬은 특히 천연기념물 제18호로 지정 보호되고 있는 파초일엽의 자생지며, 우리나라에서는 이곳에서만 자라는 그 분포의 북방한계가 된다.<br />(표고 : 94.8m 비고 : 85m 둘레 : 1,012m 면적 : 77,023㎡ 저경 : 342m)<br>', '2020-06-14 13:31:19', '2020-06-14 22:31:19'),
