	('80999257', '742', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '메이즈랜드의 소개정보입니다.\n\n 메이즈랜드는 세계 최장을 자랑하는 석축미로를 가지고 있는 종합테마파크로 한국이 자랑하는 아름다운 섬 제주의 삼다(돌, 바람, 여자)를 테마로하여 5.3km에 이르는 미로를 조성하였으며, 미로박물관을 함께 개설하여 미로의 기원 설화와 14세기부터 현재까지의 미로관련 유물과 퍼즐을 직접 체험하고 관람할수 있는 공간을 제공하고 있다. 미로는 돌과 나무로 이루어져 있는데 제주의 돌은 원적외선 방사량이 높고, 여자 바람 미로를 이루고 있는 서양측백나무 역시 피톤치드 방출량이 높아 단순히 미로를 걷는 것이 아닌 건강을 함께 생각한 자연친화적 테마이다.메이즈랜드의 부지는 40년간 가꾸어져 왔으며 40년된 다양한 수목들이 부지 전체를 감싸고 있고 이러한 수목들은 산림욕을 위한 최적의 장소이다.<br>', '2020-06-14 14:47:30', '2020-06-14 23:47:30'),
