	('80999257', '765', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '제주 세계자연유산센터의 소개정보입니다.\n\n<b>※ 코로나바이러스감염증-19 공지사항<br>※ 내용 : 임시휴관 (2020.02.25 ~ 미정)</b><br><u><a href="https://korean.visitkorea.or.kr/notice/news_detail.do?nwsid=8cdd65e1-59f1-4904-8bc9-884001e40911" title="여행정보 변동사항 페이지로 이동">→ 코로나바이러스감염증-19 여행정보 변동사항 확인하기</a></u><br><br>제주 세계자연유산센터는 대한민국에서 유일한 유네스코 세계자연유산으로서의 가치를 널리 알리기 위해 조성되었다. 4D영상관에서 제주의 환상적인 자연을 온몸으로 느끼고, 리프트를 타고 제주도 탄생과정 체험, 직접 가 볼 수 없는 용암 동굴 체험 등 교과서에 실린 세계자연유산 제주를 직접 체험해 볼 수 있다. 제주 세계자연유산센터는 2007년 유네스코 세계자연유산 등재, 2009 환경부 선정 생태관광 20선, 2010 한국형 생태관광 10모델에 선정된 대표적인 생태관광지 유네스코 세계자연유산 거문오름에 위치해 있다.<br /><br />* 개관일 2012년 9월 4일<br>', '2020-06-15 01:34:24', '2020-06-15 10:34:25'),
