	('80999257', '1032', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '삼성혈의 소개정보입니다.\n\n국가지정문화재 사적 제134호로 지정되어 있는 삼성혈은 태초에 탐라를 창건한 고을나, 양을나, 부을나 삼신이 용출했다고 전해지는 곳이다. 古記(高麗史 등)에 의하면 삼신인은 수렵생활을 하면서 피의육식(皮衣肉食)하다가 동해의 벽랑국(碧浪國)에서 오곡(五穀)의 종자(種子)와 육축(六畜)을 가지고 온 삼공주와 혼례를 한후 제각기 생활터전을 마련하기 위하여 활을 쏘아 도읍을 정하였다고 한다. 그리하여 이 땅 제주를 제1도(제주), 제2도(대정), 제3도(정의)로 분할해, 부족국가를 세우고 산업을 일으켜 융성하였다고 한다.이들 삼신인이 나왔던 혈(穴)은 품(品)자형으로 자리잡고 있는데, 이 혈속에는 빗물이나 눈이 스며들지 않으며 주변나무들이 혈을 향하고 있는 모습이 마치 삼신인에게 절을 하고 있는 모습과 같아 방문객들의 놀라움을 자아낸다. 이곳에는 수령 5백여년 된 노송들과 녹나무, 백일홍, 조록나무 등이 울창하여 도심 속의 숲을 연출하고있다.삼성혈의 성역화는 조선조 중종 때 (1526년) 목사 이수농이 처음 표단과 홍문을 세우고 담장을 쌓아 봄, 가을 제사하기 시작하여 현재 매년 춘,추기 대제(양력 4월 10일, 10월 10일) 및 건시 대제(양력 12월 10일)를 지내고 있다.', '2020-06-16 10:05:58', '2020-06-16 19:05:59'),
