	('80999257', '1036', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '한라산의 소개정보입니다.\n\n한라산 등반시 거쳐야 하는 여러 갈래 코스 중의 하나가 성판악이다. 성판악 코스는 관음사 코스와 더불어 백록담이 보이는 화구륜 코스까지 오를 수 있는 한라산 동쪽 코스로 경사가 완만하다. 2003년 3월부터 정상 등반이 연중 가능하다.<br> 제주시와 서귀포를 잇는 5.16도로의 중간 지점 가장 높은 곳에 성판악휴게소가 있는데, 이곳은 한라산으로 오르는 등산로 중의 하나인 성판악 등산로가 시작되는 곳이다. 등산로에는 서어나무 등 활엽수가 우거져서 삼림욕하면서 걷기에 좋다. 주위에는 갖가지 나무가 자라고 있고 철마다 변화 하는 한라산의 아름다움을 느낄 수 있는 곳이다. 성판악 등산로를 따라 정상으로 가다 보면 도중에 높이 1,215m의 성판악을 지나게 된다. <br>', '2020-06-16 10:10:32', '2020-06-16 19:10:33'),
