	('1087356828', '1156', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '보덕사의 소개정보입니다.\n\n보덕사는 제주시 도남동에 자리한 대한불교조계종 제23교구 본사 관음사의 말사이다. 사찰이 있으리라 믿어지지 않는 도심 속에 고요히 자리하고 있다. 주위에 법원, 시청 많은 아파트 등이 보덕사를 둘러싸고 있다. 보덕사에는 창건 당시 안봉려관 스님이 해남 대흥사(大興寺)에서 모셔온 17세기의 목조 여래좌상이 봉안되어 있다. 이 불상은 현재 대웅전을 신축하여 모셨는데, 근대 제주불교 중흥기에 선봉 스님이 각 사찰마다 모시고 다니면서 그곳 불사에 힘을 실어주었다는 일화로 더 유명하다. 보덕사 경내에는 1992년에 석조 지장보살상을 봉안하였는데, 이로써 지장도량으로 거듭나며 중생제도에 앞장서고 있다. 제주 불교 중흥의 맥을 면면히 이어오고 있는 보덕사는 현재에도 소원성취를 기원하는 많은 불자들의 귀의처로 끊임없는 발길이 이어지고 있다.', '2020-06-17 02:37:45', '2020-06-17 11:37:48'),
	('1087356828', '1157', '44389491', 'Younghoon', 'KANG', '보덕사 근처 관광지 말해주라', '2020-06-17 02:37:53', '2020-06-17 11:37:56'),
