	('1087356828', '1164', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '천지연폭포의 소개정보입니다.\n\n그 이름만큼이나 빼어난 서귀포 천지연(天地淵)폭포는  조면질 안산암의 기암절벽이 하늘높이 치솟아 마치 선계(仙界)로 들어온 것같은 황홀경을 느끼게 한다. 천지연계곡에는 천연기념물 제163호로 지정된 담팔수 자생지 이외에도 가시딸기, 송엽란 등의 희귀식물과 함께 계곡 양쪽에  구실잣밤나무, 산유자나무, 동백나무 등의 난대성 식물들이 울창한 숲을 이루고 있어 천연기념물 제379호로 지정 보호되고 있다. 특히 담팔수나무는 담팔수과의 상록교목으로  우리나라에서는 안덕계곡, 천제연, 효돈천 등 제주도 남쪽해안이 섶섬, 문섬 등이 그 북한지이다.\n\n이 천지연난대림지대를 따라 나 있는 산책로를 1㎞쯤 걸어 들어가면 웅장한 소리를 내며 떨어지는 폭포와 만나게 된다. 서귀포항 어귀에서 길게 뻗은 오솔길에는 꽃치자, 왕벚나무,철쭉 등의 아름다운 꽃나무와 더불어 정취어린 돌징검다리, 숲사이 군데군데 마련된 쉼터가 최상의 데이트 코스를 연출해주므로 신혼부부나 연인들 사이에 무척 인기가 높다. 또한 폭 12m, 높이 22m에서 세차게 떨어져 수심 20m의 호(湖)를 이루는 천지연의 맑고 깊은 물은  천연기념물 제 27호로 지정되었으며, 무태장어(천연기념물 제258호)의  서식지로서도 유명하다. 야간조명시설이 돼있어 11~4월에는 밤 10시까지 5~10월까지는 밤 11시까지 야간관광이나 데이트를 즐길 수 있는 코스로 최적지이다. 매년 서귀포칠십리축제가 이곳을 중심으로 화려하게 펼쳐지기도 한다.\n\n* 천지연 얼굴\n최근 천지연 물 위에 비쳐진 바위의 형상이 사람 얼굴을 닮아 화제가 되고 있다. 천지연 기원의 다리 상류의 보 위에 자리잡고 있는 이 바위의 형상이 그 자체로는 흔한 바위지만 물 위에 비친 형상과 합쳐지면 사람의 얼굴처럼 보인다고 한다. 왼쪽에서 보면 큰 어른 얼굴이고 오른쪽에서 보면 다소곳한 어린 아기의 얼굴로 보여진다고 한다.\n관광지관리사무소는 "바위의 형상만 보면 사람의 얼굴이라는 생각이 안들지만 마치 물감을 도화지에 뿌리고 반으로 접으면 양쪽에 똑같은 그림이 나오는 것처럼 물위에 비친 형상까지 합쳐서 보면 신기하게도 사람의 얼굴임을 알 수 있다"며 "그 모습도 오전보다는 해가 서쪽으로 기우는 오후가 되면 더욱 뚜렷이 나타난다"고 천지연을 찾는 관광객들에게 설명하고 있다.\n\n* 무태장어 서식지\n천연기념물 제258호인 무태장어는 회유성 어류로서 하천이나 호수의 비교적 깊은 곳에서 산다. 육식성이며, 깊은 바다에서 산란한다. 몸은 황갈색이고 배는 백색이며, 온몸에는  흑갈색 반문이 흩어져 있다. 낮에는 소에 숨고 밤에는 얕은 곳으로 나와 먹이를 잡아 먹는데 큰것은 길이가 2m, 무게가 20㎏에 이른다. 국가에서는 무태장어가 서식하는 천지연 일대 무태장어 서식지를 천연기념물 제27호로 지정보호하고 있다.\n\n* 서귀포층의 패류화석\n천지연하류 서남쪽 해변에 위치한 화석지대로서 제 3기인 플라이오세에 속하는 해성층이 발달하여 있는데 이것이 서귀포층이다. 이 지층은 주로 회색 또는 회갈색을 띤 사암류 및  점토로 구성되어 있고 조기패류와 동물화석들이 섞여 있다.', '2020-06-17 02:44:29', '2020-06-17 11:44:31'),
	('1087356828', '1165', '44389495', 'Younghoon', 'KANG', '천지연 폭포근처 관광지 말해줘', '2020-06-17 02:44:50', '2020-06-17 11:44:52'),
	('1087356828', '1166', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '\'천지연\' 근처 관광지입니다.\n1. 삼매봉 (제주특별자치도 서귀포시 남성로115번길 83)\n2. 새섬 새연교 (제주특별자치도 서귀포시 남성중로 40)\n3. 서귀본향당 (제주특별자치도 서귀포시 이중섭로 23-11)\n4. 서귀포 하논분화구 (제주특별자치도 서귀포시 일주동로 8823)\n5. 서귀포유람선 뉴파라다이스호 (제주특별자치도 서귀포시 남성중로 40)', '2020-06-17 02:44:51', '2020-06-17 11:44:53'),
	('1087356828', '1167', '44389496', 'Younghoon', 'KANG', '삼성혈', '2020-06-17 02:45:27', '2020-06-17 11:45:29'),
	('1087356828', '1168', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '삼성혈의 소개정보입니다.\n\n국가지정문화재 사적 제134호로 지정되어 있는 삼성혈은 태초에 탐라를 창건한 고을나, 양을나, 부을나 삼신이 용출했다고 전해지는 곳이다. 古記(高麗史 등)에 의하면 삼신인은 수렵생활을 하면서 피의육식(皮衣肉食)하다가 동해의 벽랑국(碧浪國)에서 오곡(五穀)의 종자(種子)와 육축(六畜)을 가지고 온 삼공주와 혼례를 한후 제각기 생활터전을 마련하기 위하여 활을 쏘아 도읍을 정하였다고 한다. 그리하여 이 땅 제주를 제1도(제주), 제2도(대정), 제3도(정의)로 분할해, 부족국가를 세우고 산업을 일으켜 융성하였다고 한다.이들 삼신인이 나왔던 혈(穴)은 품(品)자형으로 자리잡고 있는데, 이 혈속에는 빗물이나 눈이 스며들지 않으며 주변나무들이 혈을 향하고 있는 모습이 마치 삼신인에게 절을 하고 있는 모습과 같아 방문객들의 놀라움을 자아낸다. 이곳에는 수령 5백여년 된 노송들과 녹나무, 백일홍, 조록나무 등이 울창하여 도심 속의 숲을 연출하고있다.삼성혈의 성역화는 조선조 중종 때 (1526년) 목사 이수농이 처음 표단과 홍문을 세우고 담장을 쌓아 봄, 가을 제사하기 시작하여 현재 매년 춘,추기 대제(양력 4월 10일, 10월 10일) 및 건시 대제(양력 12월 10일)를 지내고 있다.\n\n* 삼성혈의 이용권/입장권을 미리 구매할 수 있어요!\nwww.tamnao.com/web/sp/detailPrdt.do?prdtNum=SP00000464&prdtDiv=COUP', '2020-06-17 02:45:32', '2020-06-17 11:45:34'),
