	('1087356828', '1170', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '\'삼성혈\' 근처 관광지입니다.\n1. 관덕정(제주) (제주특별자치도 제주시 관덕로 19)\n2. 귤림서원 (제주특별자치도 제주시 이도1동)\n3. 두맹이골목 (제주특별자치도 제주시 동문로14길 13)\n4. 보덕사(제주) (제주특별자치도 제주시 독짓골8길 26)\n5. 복신미륵 (제주특별자치도 제주시 건입동)', '2020-06-17 02:45:53', '2020-06-17 11:45:55'),
