	('1087356828', '1172', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '관덕정의 소개정보입니다.\n\n제주도내에서 가장 오래된 건축물 중의 하나인 관덕정은 보물 제322호로서 조선 시대 세종 30년(1448)에 목사 신숙청이 사졸들을 훈련시키고 상무 정신을 함양할 목적으로 이 건물을 세웠다. 관덕정이란 이름은 [사이관덕]이란 문구에서 나온 것으로 활을 쏘는 것은 평화시에는 심신을 연마하고 유사시에는 나라를 지키는 까닭에 이를 보는 것은 덕행으로 태어난 곳이다. 대들보에는 십장생도, 적벽대첩도, 대수렵도 등의 격조높은 벽화가 그려져 있고, 편액은 안평대군의 친필로 전해오고 있다.', '2020-06-17 02:46:05', '2020-06-17 11:46:07'),
