	('1087356828', '1180', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '\'산지천\' 근처 관광지입니다.\n1. 관덕정(제주) (제주특별자치도 제주시 관덕로 19)\n2. 귤림서원 (제주특별자치도 제주시 이도1동)\n3. 두맹이골목 (제주특별자치도 제주시 동문로14길 13)\n4. 모충사 (제주특별자치도 제주시 사라봉길 75)\n5. 보림사(제주) (제주특별자치도 제주시 사라봉동길 61)', '2020-06-17 03:26:30', '2020-06-17 12:26:32'),
