	('1087356828', '1182', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '복신미륵의 소개정보입니다.\n\n동·서로 서 있어 각각 동자복, 서자복이라 하는데, 동자복은 건입동 만수사터인 개인주택 안에 있고, 서자복은 용화사 안에 자리하고 있다. 용화사 안에 자리하고 있는 서자복은, 옛날 제주성의 서쪽에서 성 안을 수호하는 기능을 하였다 한다.‘자복신(재물과 복의 신)’,‘자복미륵’,‘미륵불’,‘큰 어른’이라 불리워지며, 신장 273㎝, 얼굴길이 135㎝, 아랫몸 둘레 315㎝의 크기인데,  높이 66㎝의 받침돌 위에서 있다. 돌하루방과 같은 형태의 돌모자를 쓰고 있으며, 인자하게 내려다보는 눈, 우뚝한 코, 지그시 다문 입, 커다란 귀 등에서  자비로운 모습을 보여준다. 곁에는 높이 75㎝, 둘레 100㎝가 되는 남근을 상징하는 동자상이 서 있는데, 여기에 걸터앉아 치성을 드리면 아들을 낳는다고 믿고 있다. 매년 음력 2월15일과 11월15일 이면 미륵을 위한 불공이 법당 안에서 행하여진다. 정확한 제작시기는 알 수 없지만 고려시대로 추정하며,  고을을 수호하고 아들 낳기를 바라는 민간신앙과 불교의 결합을 보여주는 좋은 예이다. 동자복은 서자복과 모습이 비슷하나 눈위에 눈썹이 있는 것이 특징이다.', '2020-06-17 03:26:40', '2020-06-17 12:26:42'),
