	('1087356828', '1207', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '산지천의 소개정보입니다.\n\n산지천(山地川)은 제주시 최고의 번화가인 동문시장 입구 맞은편에 흐르는 하천이다. 산업화가 한창이던 1960년대에 산지천을 복개(覆蓋)하여 주택과 상가건물이 형성되면서 환경오염되는 문제가 생기자 1995년도에 산지천을 문화와 역사의 모습 그대로 되살리기 위한 복원사업을 시작하여 2002년 맑은 물이 흐르는 현재의 산지천 모습을 갖게 되었다. 지금 산지천 물속에는 은어(銀魚), 숭어, 밀어(密魚), 붕어 등의 민물고기들이 서식하고 있어 여름철이면 낚시를 즐기는 사람들과 아이들이 수영하는 모습을 종종 볼 수 있다.\n산지천 하류인 포구는 고기낚는 돛배와 백로, 갈매기가 어우러진 광경이 아름다워 영주10경(瀛州十景) 중의 하나인 산포조어(山浦釣漁), 즉 바다낚시로 유명한 곳이다. 특히 산지천이 끝나는 곳에는 \'중국피난선(中國避難船)\'을 복원하여 전시하고 있는데 이곳은 누구든지 관람이 가능하다. 또한 하천을 따라 산책로와 공원, 음악분수대를 조성하고, 매년 여름과 겨울에는 지역관광 활성화를 위해 \'산지천 예술마당\'과 같은 역사생태하천인 산지천 산책과 함께 즐길 수 있는 다양한 문화행사ㆍ공연이 펼쳐져 많은 사람들에게 사랑을 받고 있다.', '2020-06-17 03:44:39', '2020-06-17 12:44:43'),
