	('1087356828', '1223', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '기상청에서 2020년 06월 17일 11시 00분에 발표한 \n오늘 15시 00분 기준 예보입니다.\n제주시 하늘은 \'맑음\' 입니다. \n기온은 22\'C, 습도는 80% 입니다. 강수확률은 30% 입니다.', '2020-06-17 03:54:16', '2020-06-17 12:54:18'),
	('1087356828', '1224', '44389525', 'Younghoon', 'KANG', '삼성혈', '2020-06-17 03:56:12', '2020-06-17 12:56:15'),
	('1087356828', '1225', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '삼성혈의 소개정보입니다.\n\n국가지정문화재 사적 제134호로 지정되어 있는 삼성혈은 태초에 탐라를 창건한 고을나, 양을나, 부을나 삼신이 용출했다고 전해지는 곳이다. 古記(高麗史 등)에 의하면 삼신인은 수렵생활을 하면서 피의육식(皮衣肉食)하다가 동해의 벽랑국(碧浪國)에서 오곡(五穀)의 종자(種子)와 육축(六畜)을 가지고 온 삼공주와 혼례를 한후 제각기 생활터전을 마련하기 위하여 활을 쏘아 도읍을 정하였다고 한다. 그리하여 이 땅 제주를 제1도(제주), 제2도(대정), 제3도(정의)로 분할해, 부족국가를 세우고 산업을 일으켜 융성하였다고 한다.이들 삼신인이 나왔던 혈(穴)은 품(品)자형으로 자리잡고 있는데, 이 혈속에는 빗물이나 눈이 스며들지 않으며 주변나무들이 혈을 향하고 있는 모습이 마치 삼신인에게 절을 하고 있는 모습과 같아 방문객들의 놀라움을 자아낸다. 이곳에는 수령 5백여년 된 노송들과 녹나무, 백일홍, 조록나무 등이 울창하여 도심 속의 숲을 연출하고있다.삼성혈의 성역화는 조선조 중종 때 (1526년) 목사 이수농이 처음 표단과 홍문을 세우고 담장을 쌓아 봄, 가을 제사하기 시작하여 현재 매년 춘,추기 대제(양력 4월 10일, 10월 10일) 및 건시 대제(양력 12월 10일)를 지내고 있다.\n\n* 삼성혈의 이용권/입장권을 미리 구매할 수 있어요!\nwww.tamnao.com/web/sp/detailPrdt.do?prdtNum=SP00000464&prdtDiv=COUP', '2020-06-17 03:56:20', '2020-06-17 12:56:22'),
	('1087356828', '1226', '44389526', 'Younghoon', 'KANG', '삼성혈 어딨어?', '2020-06-17 03:56:37', '2020-06-17 12:56:39'),
	('1087356828', '1227', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '오백나한의 소개정보입니다.\n\n한라산 백록담 서남쪽 해발 1천 600여m의 허리에 둘레 약 3,309m, 계곡 깊이 389여m에 2천여 개의 기암으로 둘러싸인 계곡으로 한라산을 대표하는 들어서면 하늘을 찌를 듯 솟구쳐 버티어 서있는 2천여 개의 돌기둥과 절벽사이로 샘솟는 물소리, 새소리와 구슬픈 가락의 뻐꾸기 소리에 실린 안개가 절벽의 허리를 두르면 심산계곡의 극치가 되며 웅장한 대자연의 교향악이 된다. 절벽의 동쪽은 5백여 개가 넘는 형형색색의 모양을 한 1경승지이다. 1100도로 영실 등반로 입구에서 약 6.5㎞ 들어온 이곳은 백록담, 물장올과 함께 한라산 3대 성소 중의 하나로서 이 계곡에 0~20m의 돌기둥이 울창한 숲사이를 뚫고 서 있어 마치 장군이 서 있는 것 같기도 하고 나한불상이 공대하여 서 있는 것 같기도 하다. 서쪽 벽 역시 1천2백여 개의 바위기둥이 한데 붙어 서 있어 마치 장삼으로 예장한 불이 공대하여 서 있는 것 같다. 이 바위를 모양에 따라 병풍바위라 부르고 동쪽 5백여 개의 바위를 오백나한, 오백장군, 석라한, 영실기암이라 한다. 이 계곡의 웅장하고 둘러친 모습이 마치 석가여래가 불제자에게 설법하던 영산과 비슷하다 해서 영실이라고 불리워졌다고 하며, 이들 기암 괴석은 또한 억센 나한들과 같다하여 오백나한이라고 부른다. 동쪽 암벽에는 흰진달래, 섬바꽃, 어수리, 구상나무, 주목, 제주백회, 고채나무 등 특수 수종들이 한대성 원시림을 이루고, 서쪽 암벽에는 섬매자, 시로미, 주목, 병꽃 등 관목이 주수종을 이루면서 450여 종이 희귀식물이 자생하고 있으며, 계곡 하나를 사이에 두고 온대와 한대가 마주 보고 있는 특수 지역이기도 하다. 또, 지질학적으로도 서쪽 병풍바위는 잘 발달된 주상절리층이지만 동쪽의 기암은 모두 용암이 약대지층을 따라 분출하다가 그냥 굳어진 것으로 하나하나가 용암분출에 의해 형성된 것이다. 암석은 조면질안산암이며 이 절리대를 따라 용출된 지하수가 복류하여 강정천의 발원지가 되고 있다. 그리고 영실기암은 금강산의 만물상과 같다하여 \'한라의 만물상\'이라고도 한다.', '2020-06-17 03:56:42', '2020-06-17 12:56:44'),
	('1087356828', '1228', '44389527', 'Younghoon', 'KANG', '삼성혈 어디있어?', '2020-06-17 03:57:00', '2020-06-17 12:57:02'),
