	('1087356828', '1231', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '삼성혈의 주소는\n제주특별자치도 제주시 삼성로 22(이도일동)\n\n* 삼성혈의 이용권/입장권을 미리 구매할 수 있어요!\nwww.tamnao.com/web/sp/detailPrdt.do?prdtNum=SP00000464&prdtDiv=COUP', '2020-06-17 03:57:26', '2020-06-17 12:57:28'),
