	('80999257', '1260', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '\'한라대\' 근처 관광지입니다.\n1. 넥슨컴퓨터박물관 (제주특별자치도 제주시 노형동)\n2. 수목원테마파크(아이스뮤지엄) (제주특별자치도 제주시 은수길 69)\n3. 한라수목원 (제주특별자치도 제주시 수목원길 72)', '2020-06-17 06:21:24', '2020-06-17 15:21:26'),
