	('1087356828', '1286', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '제주성읍마을고평오고택의 정보입니다.\n\n마당을 중심으로 남향인 안거리(안채,18평)와 북향인 밖거리(바깥채, 17평)가 마주하여 서 있고, 안거리와 밖거리 사이 동쪽에 모커리(12평)가 서향으로 앉아있다. 전에는 마당 서쪽에도 동향으로 모커리가 있어 건물들이 口字形으로 배치되었었으나 이 서쪽 모커리는 1970년대 중반에 헐렸다. 그리고 안거리와 밖거리는 1979년에 보수되었다.  이 제주 성읍마을 고평오 고택은 널따란 대지 위에 건물의 배치가 규모를 갖추었을뿐더러 \'호령창\', \'부섭\'등 제주 고유의 시설과 관원숙소였다는 밖거리의 특수한 가옥구조 및 규모있는 대문간 등으로 보아 학술 가치가 높다.', '2020-06-17 06:35:16', '2020-06-17 15:35:18'),
	('1087356828', '1287', '44389557', 'Younghoon', 'KANG', '새별오름 어때요?', '2020-06-17 06:35:32', '2020-06-17 15:35:33'),
	('1087356828', '1288', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '새별오름의 정보입니다.\n\n남봉을 정점으로 남서, 북서, 북동방향으로 등성이가 있으며, 등성이마다 봉우리가 있다. 서쪽은 삼태기모양으로 넓게 열려있고, 북쪽은 우묵하게 패여 있다. 마치 별표처럼 둥그런 표창같은 5개의 봉우리가 존재한다. 전체적으로 풀밭을 이루나 북쪽사면에 일부 잡목이 형성되어 있고, 서북쪽 사면에 공동묘지가 조성되어 있다. 저녁하늘에 샛별과 같이 외롭게 서 있다하여 붙여진 이름이다. \n* 표고 519.3m /  비고 119m / 둘레  2,713m /  면적  522,216㎡  / 저경  654m', '2020-06-17 06:35:36', '2020-06-17 15:35:38'),
	('1087356828', '1289', '44389558', 'Younghoon', 'KANG', '우도 어때요?', '2020-06-17 06:35:42', '2020-06-17 15:35:44'),
	('1087356828', '1290', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '우도(해양도립공원)의 정보입니다.\n\n제주도 동쪽 끝, 성산포에서 북동쪽으로 약 3.8킬로미터 지점에 위치한 섬속의 섬 우도는 그 모습이 마치 소가 누워 있거나 머리를 내민 모양과 같다고 해서 그런 이름이 붙었다. 구좌읍 종달리 바닷가에서 볼 때, 소머리부터 꼬리까지 길게 이어져 있는  섬의 독특한 형상이 한 눈에 우도라는 것을 알 수 있다. 섬의 길이는 3.8km에 둘레는 17km이며, 면적은 605ha 정도이다. 우도에 사람이 살기 시작한 것은 약 150년 전인 조선 숙종 23년(1679)에 국유목장이 설치된 뒤부터였다. 당시 국마(國馬)를 관리하고 사육하기 위해 육지사람들의 왕래가 시작되었고, 이후  헌종 10년(1844)에 김석린 진사일행이 입도(入島)하여 정착했다.  \n\n우도에는 주민들이 어업과 농업에  종사하며  살고 있다.  우도는 완만한 경사의 옥토, 풍부한 어장, 우도팔경 등 천혜의 자연조건을 갖춘 관광지이다. 게다가 제주 해녀와 돌담길, 돌무덤 등 제주도만의 독특한 전통문화와 자연환경을 체험할 수 있어, 마치 제주도를 축소시켜 놓은 듯한 인상을 풍긴다. 특히, 자연절경 외에도 바다낚시, 자전거하이킹, 버스 관광, 잠수함과 유람선을 통한 바다관광 등 즐길거리가  많아서 여행의 재미를 더해준다.  \n\n섬에서 가장 높은 우도봉(132m)에 오르면 발 아래로 섬 전체의 아기자기한 풍광이 내려다 보이고, 눈 앞에는 성산 일출봉을 포함한 제주본도의 모습이 맑고 푸른  바다를 배경으로  시원스레 펼쳐진다.  우도관광은 대체로 이곳에서부터 시작되어 섬 전체를 구석구석 돌아보는 게 된다. 우도는 영화 \'시월애\'(주연 이정재, 전지현)의 촬영장소로 더욱 유명해 졌는데, 영화촬영장소였던 산호사해수욕장 주변을 거닐다 보면 산호가 부서져서 형성된 새하얀 모래사장과  눈이 부시도록 푸른바다가 절묘하게 어우러져 보는 이로 하여금 마치 영화 속의 주인공이 된 듯한 기분에 젖어들게 한다.  이처럼 그림 같은 풍경과 잘 어울리는 찻집 겸 민박집이 몇해 전에 문을 열었는데, 차 한잔의 여유를 즐기며 창밖으로 펼쳐지는 바닷가 경치를 바라보노라면 잠시 다른 세상에 온 것 같은 착각에 빠져들기도 한다.  이런 풍경 속에서라면 영화처럼 시간을 초월한 사랑도 가능하지 않을까....이처럼 때묻지 않은 자연환경과 즐길거리를 두루 갖추고 있는 천혜의 관광지 우도에는 매년 40~50만명의 관광객이 찾아들고 있다.  \n수려한 자연경관과 청정해역을 보전하고, 해양관광을 활성화하기 위해 2001년 1월1일 섬내 2개 항구(우도항 및 하우목동항)주변과 우도해상일대  25,863㎢를 우도해양군립공원으로 지정하였다. 또한, 우도는 수중 절경을 감상할 수 있는 잠수함 관광이 새롭게 선보이는  등  이전보다  더욱 해상관광지로서의 면모를 갖추게 되었다.  더군다나 일출봉 근처의 성산포항에서 뱃길로 약 15분밖에 걸리지 않을 만큼 가깝고 배에  차도 싣고 갈 수가 있어서 교통이 매우 편리하다.  그러므로 제주를 찾는 관광객이라면 꼭 한번 들러볼 만한 관광명소이다.', '2020-06-17 06:35:47', '2020-06-17 15:35:49'),
