	('1087356828', '1292', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '제주성읍마을고평오고택의 정보입니다.\n\n마당을 중심으로 남향인 안거리(안채,18평)와 북향인 밖거리(바깥채, 17평)가 마주하여 서 있고, 안거리와 밖거리 사이 동쪽에 모커리(12평)가 서향으로 앉아있다. 전에는 마당 서쪽에도 동향으로 모커리가 있어 건물들이 口字形으로 배치되었었으나 이 서쪽 모커리는 1970년대 중반에 헐렸다. 그리고 안거리와 밖거리는 1979년에 보수되었다.  이 제주 성읍마을 고평오 고택은 널따란 대지 위에 건물의 배치가 규모를 갖추었을뿐더러 \'호령창\', \'부섭\'등 제주 고유의 시설과 관원숙소였다는 밖거리의 특수한 가옥구조 및 규모있는 대문간 등으로 보아 학술 가치가 높다.', '2020-06-17 06:36:04', '2020-06-17 15:36:05'),
