	('80999257', '1342', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '국립제주박물관의 입장료는 관람료 무료\n※ 대상 : 상설전시실, 어린이체험관, 특별전시(단, 유료 특별전시 제외)\n※ 매표소에서 무료관람권 발급 후 입장', '2020-06-17 06:53:40', '2020-06-17 15:53:42'),
	('80999257', '1343', '44389585', '호경', '김', '엉또폭포는 어떤 곳이야?', '2020-06-17 06:53:45', '2020-06-17 15:53:47'),
	('80999257', '1344', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '제주마방목지의 정보입니다.\n\n※ ">문화재보호구역, 목장 내부 출입불가\n\n 한라산 너른 초원지대에서 한가로이 풀을 뜯고 뛰어노는 평화로운 풍경을 의미해서 고수목마(古數牧馬)라고 불리는 곳이다. 5.16 도로를 이용하여 제주시에서 서귀포로 가다보면 산천단을 지나서 한라산 중턱쯤에 위치한 마방목지를 만나게 된다. 봉긋한 오름과 푸른 빛깔의 들판이 넓게 펼쳐져 있고 그 곳에서 뛰어노는 말들의 모습에 제주여행의 특별함을 느끼게 된다. 마방목지의 말들은 순수한 제주의 혈통 조랑말로 1986년 이후 천연기념물 347호로 지정 보호되고 있다. 작고 아담한 몸집에 성질도 온순하여 사람을 잘 따르며, 추위와 질병을 잘 이겨내는 강인함을 가지고 있다. 매년 4월에서 11월 중순까지 제주마 130여마리를 이곳에서 볼수 있다.', '2020-06-17 06:53:50', '2020-06-17 15:53:51'),
	('80999257', '1345', '44389586', '호경', '김', '엉또폭포 어떤 곳이야?', '2020-06-17 06:53:55', '2020-06-17 15:53:57'),
	('80999257', '1346', '-1', 'bm_jto_test_bot', 'bm_jto_test_bot', '엉또폭포의 정보입니다.\n\n보일듯 말듯 숲 속에 숨어지내다 한바탕 비가 쏟아질 때 위용스러운 자태를 드러내 보이는 엉또폭포의 높이는 50m에 이른다. 주변의 기암절벽과 조화를 이뤄 독특한 매력을 발산한다.  폭포 주변의 계곡에는 천연 난대림이 넓은 지역에 걸쳐 형성되어 있으며 사시사철 상록의 풍치가 남국의 독특한 아름다움을 자아낸다. 서귀포시 강정동 월산마을을 지나 500여m 악근천을 따라 올라가거나 신시가지 강창학공원 앞도로에서 감귤밭으로 이어진 길을 따라 서북쪽으로 800m 정도 가면 엉또폭포를 만날 수 있다. 엉또폭포는 서귀포 70경 중의 하나이다. \n\n※ 100mm이상의 비가 와야 웅장한 폭포를 볼 수 있다.', '2020-06-17 06:54:00', '2020-06-17 15:54:02'),
	('80999257', '1347', '44389587', '호경', '김', '날씨가 거지 같은데 어디로 갈까?', '2020-06-17 06:54:06', '2020-06-17 15:54:08'),
